this.forEach(function (item, index) {
    var key = keySelector(item, index);
    var keyItem = result.find(function (r) { return r.key === key; });
    if (!keyItem) {
        result.push({
            key: key,
            items: [item]
        });
    }
    else {
        keyItem.items.push(item);
    }
});
